export var EMAIL = "";
export var LOGIN = false;
export var SOLVED = false;
export var TIME = 0;

export function setEMAIL(email){
    EMAIL = email;
}

export function setLOGIN(login){
    LOGIN = login;
}

export function setSOLVED(solved){
    SOLVED = solved;
}

export function setTIME(time){
    TIME = time;
}
